function statHalfDonut(t,e){nv.addGraph(function(){var n=nv.models.pieChart().x(function(t){return t.key}).showLabels(!1).width(400).height(380).donut(!0);return n.pie.startAngle(function(t){return t.startAngle/2-Math.PI/2}).endAngle(function(t){return t.endAngle/2-Math.PI/2}),d3.select("#"+t).datum(JSON.parse(e)).transition().duration(1200).attr("width",400).attr("height",380).call(n),n})}function statBar(t,e,n){nv.addGraph(function(){var a=nv.models.discreteBarChart().x(function(t){return t.label}).y(function(t){return t.value}).width(400).height(380).staggerLabels(!0).showValues(!1);return d3.select("#"+t).datum([JSON.parse(e)]).attr("width",400).attr("height",380).call(a),d3.select("#"+t).append("text").attr("x",200).attr("y",12).attr("text-anchor","middle").style("font-weight","bold").text(n),nv.utils.windowResize(a.update),a})}
